-- ----------------------------
-- Table structure for stock_history_data
-- ----------------------------
DROP TABLE IF EXISTS `stock_history_data`;
CREATE TABLE `stock_history_data` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `stock_code` varchar(16) DEFAULT NULL COMMENT '股票代码',
  `n_date` varchar(20) DEFAULT NULL COMMENT '日期',
  `open` double DEFAULT '0' COMMENT '开盘价',
  `high` double DEFAULT '0' COMMENT '最高价',
  `close` double DEFAULT '0' COMMENT '收盘价',
  `low` double DEFAULT '0' COMMENT '最低价',
  `volume` int(11) DEFAULT '0' COMMENT '成交量（手）',
  `chg` double DEFAULT '0' COMMENT '涨跌额',
  `p_chg` double DEFAULT '0' COMMENT '涨跌幅',
  `ma5` double DEFAULT '0' COMMENT '5日均价',
  `ma10` double DEFAULT '0' COMMENT '10日均价',
  `ma20` double DEFAULT '0' COMMENT '20日均价',
  `avgma5` double DEFAULT '0' COMMENT '5日均量',
  `avgma10` double DEFAULT '0' COMMENT '10日均量',
  `avgma20` double DEFAULT '0' COMMENT '20日均量',
  `turnover` double DEFAULT '0' COMMENT '换手率(指数无此项)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6705 DEFAULT CHARSET=utf8;

